import React, { Component } from 'react'
import { BrowserRouter, Link, Route } from 'react-router-dom';


export default class About extends Component {
  render() {
    return (




        <BrowserRouter>
        <Link className='margin' to={"/home"}>home</Link>
        <Link  className='margin' to={"/About"}>About</Link>
        <Link className='margin' to={"/Contact"}>Contact</Link>
        <Link className='margin' to={"/details"}>details</Link>
        
        <Route></Route>
        
        
        
        
        </BrowserRouter>
        )
  }
}
